import React from "react";
import "./style.css";
import Nav from "react-bootstrap";
import RadioButtonList from "../radio-button";

const DropDownMenu = () => {
    return (
        <React.Fragment>
            <Nav className="mr-auto">
                <RadioButtonList/>
            </Nav>
        </React.Fragment>
    );
}


export default DropDownMenu;
